import React from 'react';
import { 
    Button,
    Card,
    CardActions,
    CardContent,
    Dialog,
    DialogActions,
    DialogContent,
    DialogContentText,
    DialogTitle,
    Grid,
    Typography,
} from "@material-ui/core";

const MyCard =()=>{

    const getMatchCart=()=>{
        return (
            <Card>
                 <CardContent>
          <Grid container justify="center" alignItems="center" spacing={4}>
            <Grid item>
              <Typography variant="h5">{match["team-1"]}</Typography>
            </Grid>
            <Grid item>
              <img
                style={{ width: 85 }}
                src={require("../img/vs.png")}
                alt=""
              />
            </Grid>
            <Grid item>
              <Typography variant="h5">{match["team-2"]}</Typography>
            </Grid>
          </Grid>
        </CardContent>
                <CardActions>
                    <Grid container justify="center">

                    <Button variant="contained" color="primary">
                      Show Detail
                    </Button>
                    <Button variant="contained" color="primary">
                        {new Date().toString()}
                    </Button>
                    </Grid>
     
                    
                </CardActions>

            </Card>
        );
    };

    return getMatchCart();

   
};
export default MyCard;
